import React from 'react';
import mintz from '../../assets/mintz.png';
import FormSteps from './steps/FormSteps';
import Subject from './Subject';

const BackgroundForm = () => {
    return (
        <>
            <div className="bg-primary left-sidebar">
                <img src={mintz} className="App-logo img-fluid ms-1 mt-3" alt="logo" width="160px" /> 
                <FormSteps/>
            </div> 
            <div className="col bg-light p-5">
                <h2>Subject</h2>
                <p>Donec leo libero, bibendum quis nisi a, viverra dignissim lectus. Aliquam porta risus vel rhoncus vehicula. Aliquam porta risus vel rhoncus vehicula. Aliquam porta risus vel rhoncus vehicula. </p>

                <Subject />
            </div>
        </>
    );
};

export default BackgroundForm;
